import React, { Component } from "react";

class App extends Component{
	render(){
		return(
			<div className = "App">
				<nav className = "nav-wrapper indigo" style = {{ paddingLeft : "50px" }}>
					<a href = "#" className = "left brand-logo" >Site Title</a>
					<ul className = "right hide-on-med-and-down">
						<li><a href = "#" className = "btn-floating white darken-4"></a></li>
					</ul>
				</nav>

				<ul id="slide-out" className ="sidenav">
					<li><div className ="user-view">
					<a href="#name"><span class="white-text name">John Doe</span></a>
					<a href="#email"><span class="white-text email">jdandturk@gmail.com</span></a>
					</div></li>
					<li><a href="#!"><i class="material-icons">cloud</i>First Link With Icon</a></li>
					<li><a href="#!">Second Link</a></li>
					<li><div class="divider"></div></li>
					<li><a class="subheader">Subheader</a></li>
					<li><a class="waves-effect" href="#!">Third Link With Waves</a></li>
				</ul>
				<a href="#" data-target="slide-out" className ="sidenav-trigger"><i class="material-icons">menu</i></a>

			</div>
		);
	}
}

export default App;
